package ex_25042024SwitchCase;

public class lab093 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 11;
        switch (a){
            default:
                System.out.println("Default");
                break;
            case -1:
                System.out.println("11");
                break;
            case 9:
                System.out.println("10");
                break;
        }

	}

}
